import React, { FC, useState} from 'react';

type PropTypes = {
  title?:string,
  children?: never,
}

export const Test: FC<PropTypes> = ({ title }:PropTypes) => {
  const content = typeof title === 'string' ? title.toLocaleLowerCase() : null;
  const [counter, setCounter] = useState(0);

  setCounter(3);

  return (
    <>
      <h1>{content}</h1>
      <h3>{counter.toFixed()}</h3>
    </>
  );
};
